import { createRouter, createWebHistory } from 'vue-router'
import MainPage from '../components/MainPage'
import DBList from '../components/DBList'
import SmsHistory from '../components/SmsHistory'
import ThresholdList from '../components/ThresholdList'
import TablespacesList from '../components/TablespacesList'; // 수정된 컴포넌트 이름
import DailyChkView from '../components/DailyChk'; // 수정된 컴포넌트 이름
import Login from '@/views/Login.vue';
import { useAuthStore } from '@/stores/authStore';


const routes = [
  {
    path: '/',
    name: 'MainPage',
    component: MainPage,
  },
  {
    path: '/db-list',
    name: 'DBList',
    component: DBList,
  },
  {
    path: '/sms-history',
    name: 'SmsHistory',
    component: SmsHistory,
  },
  {
    path: '/threshold-list',
    name: 'ThresholdList',
    component: ThresholdList,
  },
  {
    path: '/tablespaces',  // 수정된 경로
    name: 'TablespacesList',
    component: TablespacesList,  // 컴포넌트 이름 일치
  },
    {
      path: '/dailyChk',  // 수정된 경로
      name: 'DailyChkView',
      component: DailyChkView ,  // 컴포넌트 이름 일치
    }
]

const router = createRouter({
  history: createWebHistory(),
  routes,
})

export default router
